import { useRouter } from 'next/router'
import NoteTextBox from '../../components/NoteTextBox'

const Dias = () => {
  const router = useRouter()
  const { dynamicRouteName } = router.query

  return (
    <div>
      <NoteTextBox nomeRecebido={dynamicRouteName} />
      <NoteTextBox nomeRecebido={dynamicRouteName} />
      <input type="button" value="Go to Google" onclick="window.open('http://google.com')"  />
    </div>
  )
}

export default Dias
